import React from "react";
import logo from "../images/F-logo.png";
import  '../css/SideBar.css'
import Home from '../images/icons/home.png';
import Compass from '../images/icons/compass.png';
import Tv from '../images/icons/broadcast.png';
import Beg from '../images/icons/beg.png';
import Message from '../images/icons/messenger.png';
import Save from '../images/icons/ribbon.png';
import Pie from '../images/icons/pie-chart.png';
import Logout from '../images/icons/logout.png'

export default function SideBar() {
  return (
    <div>
      <div className="S">
        <div className="S-1">
          <img src={logo}></img>
        </div>
        <hr id="hr2" />
        <div className="S-2">
            <ul>
              <li><svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-house" viewBox="0 0 16 16">
  <path fill-rule="evenodd" d="M2 13.5V7h1v6.5a.5.5 0 0 0 .5.5h9a.5.5 0 0 0 .5-.5V7h1v6.5a1.5 1.5 0 0 1-1.5 1.5h-9A1.5 1.5 0 0 1 2 13.5zm11-11V6l-2-2V2.5a.5.5 0 0 1 .5-.5h1a.5.5 0 0 1 .5.5z"/>
  <path fill-rule="evenodd" d="M7.293 1.5a1 1 0 0 1 1.414 0l6.647 6.646a.5.5 0 0 1-.708.708L8 2.207 1.354 8.854a.5.5 0 1 1-.708-.708L7.293 1.5z"/>
</svg></li>
              <li><img src={Compass}></img></li>
              <li><img src={Tv}></img></li>
              <li><img src={Beg}></img></li>
              <li><img src={Message}></img></li>
              <li><img src={Save}></img></li>
              <li><img src={Pie}></img></li>
                <hr id="hr2" />
              <li> <img src={Logout}></img>
              </li>
            </ul>
        </div>

        <div className="S-3">
       
        </div>
      </div>
    </div>
  );
}
